import React from "react";

import classes from "./Keys.module.css";
import Content from "../Layout/Content";

const Keys = () => {
  return (
    <Content>
      <div className={classes.add__keys}>
        <input type="text" placeholder="@twitterhandle" />
      </div>
    </Content>
  );
};

export default Keys;
